def train_model(model, x_train, y_train, directory, domain, problem, goal_idx_pairs, batch_size=20, epochs=100, lr=0.001):
    rep_len = len(x_train[0][0])
    sorted_pairs = sorted(zip(x_train, y_train, goal_idx_pairs), key=lambda pair: len(pair[0]), reverse=True)
    y_train = [y for (x, y, pairs) in sorted_pairs]
    sorted_x_train = [x for (x, y, pairs) in sorted_pairs]
    sorted_goal_idx_pairs = [pairs for (x, y, pairs) in sorted_pairs]
    x_train_lens = [len(x) for x in sorted_x_train]
    x_train_padded = []
    const_len = x_train_lens[0]
    pad_val = [0 for i in range(rep_len)]
    for i, length in enumerate(x_train_lens):
        padded_seq = sorted_x_train[i]
        for j in range(const_len - length):
            padded_seq.append(pad_val)
        x_train_padded.append(padded_seq)

    x_train_tensor = torch.ShortTensor(x_train_padded)
    train_ds = GoalsDataset((x_train_tensor, x_train_lens), y_train)
    train_dl = data.DataLoader(train_ds, batch_size=batch_size)

    parameters = filter(lambda p: p.requires_grad, model.parameters())
    optimizer = torch.optim.Adam(parameters, lr=lr)

    for i in range(epochs):
        model.train()
        sum_loss = 0.0
        total = 0
        for x, y, length in train_dl:
            x = x.float()
            y_pred, all_y_pred, lengths = model(x, length)
            optimizer.zero_grad()
            loss = F.cross_entropy(y_pred, y)
            loss.backward()
            optimizer.step()
            sum_loss += loss.item()*y.shape[0]
            total += y.shape[0]
        correct = count_correct(model, train_dl)
        print(correct/total)
        print("train loss %.3f, train accuracy %.3f" % (sum_loss/total, correct/total))
    plot_predictions(model, train_dl, directory, domain, problem, sorted_goal_idx_pairs)
    return model


def count_correct(model, train_dl):
    correct = 0
    for (x, y, length) in train_dl:
        x = x.float()
        y_pred, all_y_pred, lengths = model(x, length)
        pred = torch.max(y_pred, 1)[1]
        correct += (pred == y).float().sum()
    return correct


def plot_predictions(model, train_dl, directory, domain, problem, sorted_goal_idx_pairs):
    for (x, y, length) in train_dl:
        x = x.float()
        y_pred, all_y_pred, lengths = model(x, length)
        num_goals = len(all_y_pred[0][0])
        for i, length in enumerate(lengths):
            true_goal, idx = sorted_goal_idx_pairs[i]
            y_pred_i = all_y_pred[i]

            for j in range(num_goals):
                plt.plot([y_pred_i[k][j] for k in range(length)], label="Goal " + str(j))

            plt.title('True Goal=' + str(true_goal) + ', Sample Index=' + str(idx))
            plt.xlabel('Timestep')
            plt.ylabel('Probability of Goal')
            plt.legend()
            plt.axis([0, length-1, 0, 1])
            plt.savefig(os.path.join(directory, domain, "problem" + str(problem), str(i) + ".jpg"))
            plt.cla()


class GoalsDataset(data.Dataset):
    def __init__(self, X, Y):
        self.X = X
        self.y = Y

    def __len__(self):
        length = len(self.y)
        return length

    def __getitem__(self, idx):
        item = self.X[0][idx], self.y[idx], self.X[1][idx]
        return item


class LSTM_variable_input(nn.Module):
    def __init__(self, vec_rep_dim, hidden_dim, goal_count):
        super().__init__()
        self.hidden_dim = hidden_dim
        self.lstm = nn.LSTM(vec_rep_dim, hidden_dim, batch_first=True)
        self.linear = nn.Linear(hidden_dim, goal_count)

    def forward(self, x, s):
        packed = rnn.pack_padded_sequence(x, s, batch_first=True)
        out, (ht, ct) = self.lstm(packed)

        # Get final timestep output for all samples
        out_final_unnorm = self.linear(ht[0])
        out_final = F.softmax(out_final_unnorm)

        # Get output from all timesteps for all samples
        all_out, lengths = rnn.pad_packed_sequence(out, batch_first=True)
        all_out_unnorm = self.linear(all_out)
        all_out = F.softmax(all_out_unnorm, dim=2)

        # for i, length in enumerate(lengths):
        #
        #     all_out_unnorm = self.linear(all_out[i])
        #     all_out = F.softmax(all_out_unnorm)
        return out_final, all_out, lengths


